import { Component } from '@angular/core';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'AventixApp';
}
<header class=" navbar navbar-dark bg-purple">
  <a href="#" class="navbar-brand">Home</a>

  <div class="collapse navbar-collapse" id="navbarNav">
    <ul class="navbar-nav ml-auto">
      <li class="nav-item active"><a href="#">Home</a></li>
      <li class="nav-item"><a href="#" class="nav-link">Liste des classes</a></li>
      <li class="nav-item"><a href="#" class="nav-link">Liste des professeurs</a></li>
      <li class="nav-item"><a href="#" class="nav-link">Liste des matières</a></li>
